import React from 'react';
import HeaderLarge from 'views/components/display/HeaderLarge';

export default class NotFound extends React.Component {
  render() {
    return (
      <>
        <HeaderLarge displayName={"Oops, something went wrong"} />

        <p>We didn't find anything here.</p>
      </>
    );
  }
}
